                <div className="mood-img-container">
                  <img src={authContext.getMood().image}></img>
                  <div style={{ color: "#513d87", fontWeight: "600" }}>
                    {authContext.getMood().mood}
                  </div>
                </div>
                <div className="mood-desc">
                  {moodData[localDataState.moodTracker]}
                </div>
              </div>
