                  <CardMedia
                    sx={{ height: 100 }}
                    image="/counselor.jpeg"
                    title="green iguana"
                  />
                  <CardContent>
                    <Typography gutterBottom variant="h5" component="div">
                      Dr Smita
                    </Typography>
                    <Typography variant="body2" color="text.secondary">
                      Expert in Mental Wellness
                    </Typography>
                  </CardContent>
                  <CardActions>
                    <Button
                      size="small"
                      onClick={() => {
                        navigate("/chat/madhu/300/smita");
                      }}
                    >
                      Chat With Smita
                    </Button>
                  </CardActions>
                </Card>

                <Card sx={{ maxWidth: 200 }}>
                  <CardMedia
                    sx={{ height: 100 }}
                    image="/expert.jpeg"
                    title="green iguana"
                  />
                  <CardContent>
                    <Typography gutterBottom variant="h5" component="div">
                      Dr Nethra
                    </Typography>
                    <Typography variant="body2" color="text.secondary">
                      Expert in Mental Wellness
                    </Typography>
                  </CardContent>
                  <CardActions>
                    <Button
                      size="small"
                      onClick={() => navigate("/chat/madhu/300/smita")}
                    >
                      Chat With Nethra
                    </Button>
                  </CardActions>
                </Card>

                <Card sx={{ maxWidth: 200 }}>
                  <CardMedia
                    sx={{ height: 100 }}
                    image="/counselor.jpeg"
                    title="green iguana"
                  />
                  <CardContent>
                    <Typography gutterBottom variant="h5" component="div">
                      Dr Shrithi
                    </Typography>
                    <Typography variant="body2" color="text.secondary">
                      Expert in Mental Wellness
                    </Typography>
                  </CardContent>
                  <CardActions>
                    <Button
                      size="small"
                      onClick={() => navigate("/chat/madhu/300/smita")}
                    >
                      Chat With Shrithi
                    </Button>
                  </CardActions>
                </Card>
              </div>

              <div>
                <div></div>
                <div></div>
              </div>
            </div>
          )}
        </div>
      )}
    </div>

    // <div className="dashboard-main-container">
    //   <h1>Your Dashboard</h1>
    //   <div>
    //     <Questions></Questions>
